import PizzaSelectForm from '../components/PizzaSelectForm'
import PizzaStatusDisplay from '../components/PizzaStatusDisplay'

export default function Index() {
	return (
		<div>
			<h1>Velkommen til bLAN!</h1>
			<PizzaSelectForm />
			<PizzaStatusDisplay />
		</div>
	)
}
